import "./share.css";
function Share() {
  return (
    <div className="share">
      <div className="shareWrapper">
        <div className="shareTop">
          <img src="/assets/profile/" alt="" className="shareProfileImg" />
          <input placeholder="What's in your mind svm" className="shareInput" />
        </div>
        <div className="shareBottom"></div>
      </div>
    </div>
  );
}
export default Share;
